import { Center, Button, ButtonText, ButtonIcon, ButtonGroup, Icon, AddIcon, InfoIcon, ButtonSpinner, ArrowUpIcon, Heading, HStack, ThreeDotsIcon, Input, InputField } from '@gluestack-ui/themed';
import React from 'react';
import { GluestackUIProvider, Box, Text, VStack,Pressable } from '@gluestack-ui/themed';
import { config } from '@gluestack-ui/config';


function Reproductorjsjs () {
    return(
    <VStack space="md" reversed={false} backgroundColor='$black' alignItems='center'>

                    
 <Pressable p="$9" paddingTop={"$9"} bg="$primary500"  $hover-bg="$primary400"  width={150} variant='solid' >
   {({ pressed }) => (
        <Text fontSize="$md" color={pressed ? 'pink' : 'yellow'}>Puchale papito</Text>
      )}
</Pressable>

    </VStack>
    )
};

export default Reproductorjsjs
